import React from "react";

const CheckOutPaymentItem = ({ item }) => {
  const {
    linkUrl,
    imageUrl,
    descriptionTitle,
    rating,
    price,
    amazonChoice,
    bestSeller,
  } = item;
  return (
    <div>
      <div>{descriptionTitle}</div>
      <span>{price}</span>
      <img alt="" src={imageUrl}></img>
    </div>
  );
};

export default CheckOutPaymentItem;
